import './App.css';
import React from "react";

import { 
  BrowserRouter as Router, 
  Route, Switch, 
  Link, 
  Redirect 
} from "react-router-dom";

// Pages
import MainPage from "./pages"

function App() {
  return (
    <Router>
      <Switch>
      <Route path="/" component={MainPage} />
      <Route  />
      </Switch>
    </Router>
  );
}

export default App;
